import { StyleSheet, Text, View, ScrollView } from 'react-native';
import { Provider, useDispatch } from 'react-redux'
import { getSudokuBoard} from './store/actions/sudokuActions'



export const Home = () => {
  const dispatch = useDispatch()
  useEffect( () => {
    console.log('masuk')
    dispatch(getSudokuBoard())
  },[dispatch])

  return (
    <Text> ini home </Text>
  )
}
